import React from 'react';
import { Link } from 'react-router-dom';

const AdminPanel = () => {
    const [userRole, setUserRole] = useState('');

  useEffect(() => {
    // Получите данные о пользователе, включая роль, с вашего сервера.
    // Замените 'http://localhost:5000/users/me' на ваш реальный эндпоинт.
    const fetchUserData = async () => {
      try {
        const response = await fetch('http://localhost:5000/users/me', {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        });
        const data = await response.json();
        setUserRole(data.role); // Предполагается, что роль приходит в ответе с сервера.
      } catch (error) {
        console.error('Error fetching user data:', error);
      }
    };

    fetchUserData();
  }, []);
  return (
    <div className="container mt-5">
      <div className="row">
        <div className="col-md-4">
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">Управление категориями</h5>
              <p className="card-text">Управление категориями товаров</p>
              <Link to="/admin/categories" className="btn btn-primary">
                Перейти
              </Link>
            </div>
          </div>
        </div>
        <div className="col-md-4">
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">Управление брендами</h5>
              <p className="card-text">Управление брендами товаров</p>
              <Link to="/admin/brands" className="btn btn-primary">
                Перейти
              </Link>
            </div>
          </div>
        </div>
        <div className="col-md-4">
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">Управление товарами</h5>
              <p className="card-text">Управление товарами в магазине</p>
              <Link to="/admin/products" className="btn btn-primary">
                Перейти
              </Link>
            </div>
          </div>
        </div>
      </div>
      <div className="row mt-4">
        <div className="col-md-4">
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">Управление блогами</h5>
              <p className="card-text">Управление материалами блога</p>
              <Link to="/admin/blogs" className="btn btn-primary">
                Перейти
              </Link>
            </div>
          </div>
        </div>
        <div className="col-md-4">
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">Управление пользователями</h5>
              <p className="card-text">Управление пользователями сайта</p>
              <Link to="/admin/users" className="btn btn-primary">
                Перейти
              </Link>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminPanel;
